import React from 'react';
import { motion } from 'framer-motion';
import JRAutoDetailing from './HeroSection';

function App() {
  return (
    <motion.div 
      className="App"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.5 }}
    >
      <JRAutoDetailing />
    </motion.div>
  );
}

export default App;
